Vector2f sample_default_shading(float wo_dot_normal, float roughness) {
    using namespace Bifrost::Math;

    float roughness_coord = roughness * (default_shading_roughness_sample_count - 1);
    int lower_roughness_row = int(roughness_coord);
    int upper_roughness_row = min(lower_roughness_row + 1, default_shading_roughness_sample_count - 1);

    float wo_dot_normal_coord = wo_dot_normal * (default_shading_angle_sample_count - 1);
    int lower_wo_dot_normal_column = int(wo_dot_normal_coord);
    int upper_wo_dot_normal_column = min(lower_wo_dot_normal_column + 1, default_shading_angle_sample_count - 1);

    // Interpolate by wo_dot_normal
    float wo_dot_normal_t = wo_dot_normal * (default_shading_angle_sample_count - 1) - lower_wo_dot_normal_column;
    const Vector2f* lower_rho_row = default_shading + lower_roughness_row * default_shading_roughness_sample_count;
    Vector2f lower_rho = lerp(lower_rho_row[lower_wo_dot_normal_column], lower_rho_row[upper_wo_dot_normal_column], wo_dot_normal_t);

    const Vector2f* upper_rho_row = default_shading + upper_roughness_row * default_shading_roughness_sample_count;
    Vector2f upper_rho = lerp(upper_rho_row[lower_wo_dot_normal_column], upper_rho_row[upper_wo_dot_normal_column], wo_dot_normal_t);

    // Interpolate by roughness
    float roughness_t = roughness_coord - lower_roughness_row;
    return lerp(lower_rho, upper_rho, roughness_t);
}

